import Movie from "./Movie";

function MovieList(props){
    return(
        <>
        {props.fetchData.map}
        <Movie title={props.fetchData.title} overview={props.fetchData.overview} image={props.fetchData.poster_path}/>

        </>
    );
}

export default MovieList;
